import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Find and click the "Your Profile" link using text selector (first occurrence)
    const profileLink = await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await profileLink.click();

    // Wait for possible profile content to load (look for profile image or profile name)
    // Try to find the profile image using alt text or class
    let profileImageUrl = null;
    let fullName = null;
    let username = null;
    let bio = null;

    // Try to find the profile image (using class .profile-image)
    try {
      const profileImgEl = await page.waitForSelector('img.profile-image', { timeout: 3000 });
      profileImageUrl = await profileImgEl.getAttribute('src');
    } catch {}

    // Try to extract full name (inside .profile-info h2)
    try {
      const nameEl = await page.waitForSelector('.profile-info h2', { timeout: 3000 });
      fullName = (await nameEl.textContent()).trim();
    } catch {}

    // Try to extract username (inside .username)
    try {
      const usernameEl = await page.waitForSelector('.username', { timeout: 3000 });
      username = (await usernameEl.textContent()).replace(/^@/, '').trim();
    } catch {}

    // Try to extract bio (inside .bio)
    try {
      const bioEl = await page.waitForSelector('.bio', { timeout: 3000 });
      bio = (await bioEl.textContent()).trim();
    } catch {}

    // Take screenshot of profile section if found
    let profileShot = null;
    try {
      const profileHeader = await page.waitForSelector('.profile-header', { timeout: 3000 });
      profileShot = path.join(screenshotsDir, 'step_2_profile_section.png');
      await profileHeader.screenshot({ path: profileShot });
      screenshots.push(profileShot);
    } catch {
      // If profile header not found, take a full page screenshot instead
      const fallbackShot = path.join(screenshotsDir, 'step_2_profile_fallback.png');
      await page.screenshot({ path: fallbackShot });
      screenshots.push(fallbackShot);
    }

    // Extract profile stats (Orders, Reviews, Seller Rating)
    let totalOrders = null;
    let totalReviews = null;
    let sellerRating = null;
    try {
      const statNumbers = await page.$$eval('.profile-stats .stat-number', els => els.map(e => e.textContent.trim()));
      if (statNumbers.length >= 3) {
        totalOrders = statNumbers[0];
        totalReviews = statNumbers[1];
        sellerRating = statNumbers[2];
      }
    } catch {}

    // Extract Jun's recent reviews (review titles and ratings)
    let recentReviews = [];
    try {
      const reviewEls = await page.$$('.reviews-list .review-item');
      for (const reviewEl of reviewEls) {
        let title = null;
        let rating = null;
        try {
          title = await reviewEl.$eval('.review-title', el => el.textContent.trim().replace(/"/g, ''));
        } catch {}
        try {
          rating = await reviewEl.$eval('.stars', el => el.textContent.trim());
        } catch {}
        if (title) {
          recentReviews.push({ title, rating });
        }
      }
    } catch {}

    // Extract Jun's products (titles)
    let junProducts = [];
    try {
      const productEls = await page.$$('.profile-sections .section:nth-child(1) .products-grid .product-card .product-title');
      for (const prodEl of productEls) {
        const prodTitle = (await prodEl.textContent()).trim();
        if (prodTitle) junProducts.push(prodTitle);
      }
    } catch {}

    return {
      success: true,
      action: "Harvested user profile information including name, username, bio, stats, reviews, and products.",
      extractedData: {
        profileImageUrl,
        fullName,
        username,
        bio,
        totalOrders,
        totalReviews,
        sellerRating,
        junProducts,
        recentReviews
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
